b898a54a2fd638a5ea8af527af4fed72c1196794:
query BotStats {
  botStats {
    nodes {
      category
      name
      count
      __typename
    }
    __typename
  }
}

5c7abadb3785e8c80bcbcde5f36427e5bd8dae8d:
query CachedGuild($guildId: BigInt!) {
  cachedGuild(id: $guildId) {
    name
    icon
    banner
    splash
    __typename
  }
}

f237951a527540cd8926a4dfabacf2bf66b9f6ca:
query CurrentUser {
  currentUser {
    avatar
    createdAt
    details
    discriminator
    id
    isAdmin
    updatedAt
    username
    __typename
  }
}

10972029ece7cb031b881bb47b429f92d49db80e:
query GuildTags($guildId: BigInt!) {
  tags(condition: {guildId: $guildId}) {
    edges {
      node {
        content
        created
        tagName
        ownerId
        guildId
        useCount
        owner {
          id
          name
          discriminator
          avatarUrl
          __typename
        }
        __typename
      }
      cursor
      __typename
    }
    totalCount
    __typename
  }
}

7425b6ad89cb09fdf7f90027da1ee7a3d8d324b0:
query Leaderboard($timeframe: LevelTimeframe = ALL_TIME, $guildId: BigInt) {
  timeframeUserLevels(timeframe: $timeframe, guildId: $guildId, first: 50) {
    edges {
      node {
        username
        avatarUrl
        discriminator
        currentLevel
        nextLevelXpProgress
        nextLevelXpRequired
        userId
        xp
        xpDiff
        gainedLevels
        __typename
      }
      cursor
      __typename
    }
    totalCount
    __typename
  }
}

2c1a03b179c49a0fe34a07e940c6f17e944f3afd:
query WebUserGuilds {
  webUserGuilds {
    nodes {
      guildId
      manageGuild
      owner
      permissions
      guild {
        name
        icon
        __typename
      }
      __typename
    }
    __typename
  }
}
